import React from "react";


function AdminPanel({messages}) {
    return(
        <div className="AdminPanel">
            <h1>Socket.IO Chat</h1>
            <div>
                {messages.map((msg, index) => (
                    <div key={index}>{msg}</div>
                ))}
            </div>

        </div>
    )
}
export default AdminPanel;
